import React from "react";
import "./Home.css";
import { Link, useLocation } from "react-router-dom";
import { Container, Col, Row, Button, Body } from "react-bootstrap";
import logoIMG from "../Resources/RC_LOGO.png";
import OiaIMG from "../Resources/Renke_at_Oia.jpg";

function Home() {
  const { pathname } = useLocation();

  return (
    <section className="home-page">
      <Container>
        <Row className="align-items-center text-center">
          <Col md={1}>
            <div className="logo">
              <Link to="/Home" aria-label="Home">
                <img src={logoIMG} alt="Renke Cui Logo" height="120" />
              </Link>
            </div>
          </Col>
          <Col md={7}> </Col>
          <Col md={1}>
            <div className="projects-link">
              <Link
                to="/Projects"
                className={`nav-link ${
                  pathname.includes("Projects") ? "active" : ""
                }`}
                aria-current={
                  pathname.includes("Projects") ? "page" : undefined
                }
              >
                <Button variant="secondary">Projects</Button>{" "}
              </Link>
            </div>
          </Col>
          <Col md={2}>
            <div className="about-link">
              <Link
                to="/About"
                className={`nav-link ${
                  pathname.includes("About") ? "active" : ""
                }`}
                aria-current={pathname.includes("About") ? "page" : undefined}
              >
                <Button variant="secondary">About Me</Button>{" "}
              </Link>
            </div>
          </Col>
          <Col md={1}> </Col>
        </Row>
      </Container>
      <Container>
      {/* <img src={OiaIMG} alt="Background_OIA" className="img-Oia" /> */}
        <Row className="align-items-center text-center  Home-Content">

          <Col><div className="intro-box">
            </div></Col>
          <Col> </Col>
        </Row>
      </Container>
    </section>
  );
}

export default Home;

